import React, { Component } from 'react';
import Routes from './routes';
import './App.css';
import { Menu, Container } from 'semantic-ui-react';

class App extends Component {
  componentDidMount() {
    window.fetch('/api/species_loc/20')
      .then(response => response.json())
      .then(json => console.log(json))
      .catch(error => console.log(error));

    window.fetch('/api/locations/1')
      .then(response => response.json())
      .then(json => console.log(json))
      .catch(error => console.log(error));
  }
  render() {
    return (
      <div className="App" >
        <Menu fixed='top' inverted>
          <Container>
            <Menu.Item href="/" header>
              Home
            </Menu.Item>

            <Menu.Item href="/species-form" >
                Species Data
            </Menu.Item>
            <Menu.Item href="/location-form" >
                Location Data
            </Menu.Item>

            <Menu.Item href="https://developer.spotify.com"
              target="_blank"
              rel="noopener noreferrer"
              floated='right'>
              Check out Spotify's API
            </Menu.Item>
          </Container>
        </Menu>
        <Container>
          <Routes />
        </Container>
      </div>
      );
  }

}

export default App;
